import React, { useState } from 'react';
import './App.css';

function App() {
  const [email, setEmail] = useState('');
  const [name, setName] = useState('');
  const [stock, setStock] = useState('');
  const [company, setCompany] = useState('');
  const [userData, setUserData] = useState(null);
  const [searchHistory, setSearchHistory] = useState([]);
  const [userStatus, setUserStatus] = useState('');
  const [error, setError] = useState('');

  const handleEmailSubmit = async (event) => {
    event.preventDefault();
    try {
      const response = await fetch('/mongodbsearch', {
        method: 'POST',
        headers: {'Content-Type': 'application/json'},
        body: JSON.stringify({ email: email }),
      });
      const data = await response.json();
      if (response.ok) {
        setUserStatus(data.status);
        setUserData(data.data);
        if (data.status === 'found') {
          setSearchHistory(data.data.searchHistory || []);
        }
      } else {
        throw new Error(data.error || 'Something went wrong');
      }
    } catch (err) {
      setError(err.message);
    }
  };

  const handleNameSubmit = async (event) => {
    event.preventDefault();
    try {
      const response = await fetch('/submit-name', {
        method: 'POST',
        headers: {'Content-Type': 'application/json'},
        body: JSON.stringify({ email: email, name: name }),
      });
      if (!response.ok) throw new Error('Failed to save name');
      alert('Name saved successfully!');
    } catch (err) {
      setError(err.message);
    }
  };

  const handleSearchSubmit = async (event) => {
    event.preventDefault();
    try {
      const response = await fetch('/submit-search', {
        method: 'POST',
        headers: {'Content-Type': 'application/json'},
        body: JSON.stringify({ email: email, stock: stock, company: company }),
      });
      if (!response.ok) throw new Error('Failed to submit search');
      alert('Search submitted successfully!');
    } catch (err) {
      setError(err.message);
    }
  };

  return (
    <div className="App">
      <div className="App-header">
        <form onSubmit={handleEmailSubmit}>
          <label htmlFor="email">Enter your Email Address:</label>
          <input type="email" id="email" value={email} onChange={e => setEmail(e.target.value)} required />
          <button type="submit">Submit</button>
        </form>

        {userStatus === 'not_found' && (
          <form onSubmit={handleNameSubmit}>
            <label htmlFor="name">Enter your Name:</label>
            <input type="text" id="name" value={name} onChange={e => setName(e.target.value)} required />
            <button type="submit">Submit</button>
          </form>
        )}

        {userStatus && (
          <form onSubmit={handleSearchSubmit}>
            <div>Welcome {userStatus === 'found' ? 'back' : ''}, {name || userData.name}!</div>
            <label htmlFor="stock">Enter Stock Symbol:</label>
            <input type="text" id="stock" value={stock} onChange={e => setStock(e.target.value)} required />
            <label htmlFor="company">Enter Company Name:</label>
            <input type="text" id="company" value={company} onChange={e => setCompany(e.target.value)} required />
            <button type="submit">Submit</button>
          </form>
        )}

        {userStatus === 'found' && searchHistory.length > 0 && (
          <div>
            <h3>Search History:</h3>
            {searchHistory.map((item, index) => (
              <div key={index}>{item.date} - {item.company}</div>
            ))}
          </div>
        )}

        {error && <div>Error: {error}</div>}
      </div>
    </div>
  );
}

export default App;
